  const sendEmail = (e) => {
    e.preventDefault();

    emailjs
      .sendForm(
        "service_u8g8fto",
        "template_6ar6bdk",
        form.current,
        "kui3ddZmA6nrYpgju"
      )
      .then(
        (result) => {
          console.log(result.text);
          console.log("message sent");
